export const seatTemplateService = {
  getSeatIcon(seatClassType, style) {
    if (!seatClassType) return;

    const [cabinClass, type] = seatClassType.split('-');
    const seatType = parseInt(type, 10);

    if (seatType <= 4) {
      switch (cabinClass) {
        case 'F':
          return firstClassTemplates.getTemplate(seatType, style);
        case 'B':
          return businessClassTemplates.getTemplate(seatType, style);
        case 'P':
          return premiumClassTemplates.getTemplate(style);
        case 'E':
          return economyClassTemplates.getTemplate(style);
        default:
          return economyClassTemplates.getTemplate(style);
      }
    }

    return genericTemplates.getTemplate(seatType, style);
  },
};

